import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = "im gonna woop yo ass";
}
<style>
  .grid {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
    grid-gap: 20px;
  }

  .grid img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
</style>

<div class="grid">
  <img src="//cdn0070.qrcodechimp.com/images/homepage/qr-code-with-logo-spiderman.webp" alt="QR code with logo example Spiderman">
